To determine electrode potential and HOMO and LUMO energy levels of CaBa dye, cyclic voltammetry (CV) was performed in acetonitrile solution containing 0.1 N TEABF4 at a scan rate of 20 mV s−1. These values are useful to determine the thermodynamic feasibility of electron injection from the HOMO level of dye molecule into the metal oxide conduction band and electrolyte dye regeneration. Figure 2f depicts the cyclic voltammogram of CaBa dye. CaBa dye showed first oxidation potential corresponding to HOMO versus NHE at 1.08 V (Table 1) which is more positive than the redox potential of iodine/iodide electrolyte (∼0.4 V vs. NHE), indicating the regeneration of the oxidized dye ground state by accepting an electron from electrolyte [39]. The excited-state oxidation potential, i.e. LUMO energy level of the dye, was calculated from the equation ELUMO = EHOMO − E0 − 0 and was found to be −1.69 V versus NHE. The LUMO is more negative than the conduction band of TiO2 (−0.5 V vs. NHE), and it indicates that injection of photogenerated electrons into the conduction band of TiO2 is energetically permitted [40]. From these values, we can evidently deduce that CaBa dye could be used as a sensitizer in DSSC.Table 1
